import React from 'react'
import './Gallery.css'
import { file4 } from '../../Images/2019'
const Gallery4 = () => {
    return (
        <div>
            <h1 style={{ textAlign: 'center' }}>phasor 2019</h1>
            {
                file4.map((img, index) => {
                    return (
                        <div key={index} className='img'>
                            <img src={img.src} alt='error' />
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Gallery4
